import { Row, Col } from "react-bootstrap";

const Market = () => {
  return (
    <>
      <Row>
        <Row>
          <Row>
            <Col></Col>
            <Col></Col>
          </Row>
          <Row>버튼들</Row>
        </Row>
      </Row>
    </>
  );
};

export default Market;
